import toursData from '../../data/db.json'
import './Tours.css'

export default function Tours(){

    console.log(toursData);
    return toursData.map((tour)=> <Tour className="TourCard" key={tour.id} data={tour}/>);

}

function Tour(prop){

    return (
        <div >
            <img src={prop.data.image} alt= {prop.data.info}></img>
            <h2>{prop.data.name}</h2> 


        </div>
    );

}
